item.description:
 &lt;h1 id=&#34;逆波兰表达式求值&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#逆波兰表达式求值&#34;&gt;#&lt;/a&gt; 逆波兰表达式求值&lt;/h1&gt;
&lt;p&gt;给你一个字符串数组  &lt;code&gt;tokens&lt;/code&gt;  ，表示一个根据 &lt;span class=&#34;exturl&#34; data-url=&#34;aHR0cHM6Ly9iYWlrZS5iYWlkdS5jb20vaXRlbS8lRTklODAlODYlRTYlQjMlQTIlRTUlODUlQjAlRTUlQkMlOEYvMTI4NDM3&#34;&gt;逆波兰表示法&lt;/span&gt; 表示的算术表达式。&lt;/p&gt;
&lt;p&gt;请你计算该表达式。返回一个表示表达式值的整数。&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;注意：&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;有效的算符为  &lt;code&gt;&#39;+&#39;&lt;/code&gt; 、 &lt;code&gt;&#39;-&#39;&lt;/code&gt; 、 &lt;code&gt;&#39;*&#39;&lt;/code&gt;  和  &lt;code&gt;&#39;/&#39;&lt;/code&gt;  。&lt;/li&gt;
&lt;li&gt;每个操作数（运算对象）都可以是一个整数或者另一个表达式。&lt;/li&gt;
&lt;li&gt;两个整数之间的除法总是 &lt;strong&gt;向零截断&lt;/strong&gt; 。&lt;/li&gt;
&lt;li&gt;表达式中不含除零运算。&lt;/li&gt;
&lt;li&gt;输入是一个根据逆波兰表示法表示的算术表达式。&lt;/li&gt;
&lt;li&gt;答案及所有中间计算结果可以用 &lt;strong&gt;32 位&lt;/strong&gt; 整数表示。&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;示例 1：&lt;/strong&gt;&lt;/p&gt;
&lt;pre&gt;&lt;code&gt;输入：tokens = [&amp;quot;2&amp;quot;,&amp;quot;1&amp;quot;,&amp;quot;+&amp;quot;,&amp;quot;3&amp;quot;,&amp;quot;*&amp;quot;]
输出：9
解释：该算式转化为常见的中缀算术表达式为：((2 + 1) * 3) = 9
&lt;/code&gt;&lt;/pre&gt;
&lt;p&gt;&lt;strong&gt;示例 2：&lt;/strong&gt;&lt;/p&gt;
&lt;pre&gt;&lt;code&gt;输入：tokens = [&amp;quot;4&amp;quot;,&amp;quot;13&amp;quot;,&amp;quot;5&amp;quot;,&amp;quot;/&amp;quot;,&amp;quot;+&amp;quot;]
输出：6
解释：该算式转化为常见的中缀算术表达式为：(4 + (13 / 5)) = 6
&lt;/code&gt;&lt;/pre&gt;
&lt;p&gt;&lt;strong&gt;示例 3：&lt;/strong&gt;&lt;/p&gt;
&lt;pre&gt;&lt;code&gt;输入：tokens = [&amp;quot;10&amp;quot;,&amp;quot;6&amp;quot;,&amp;quot;9&amp;quot;,&amp;quot;3&amp;quot;,&amp;quot;+&amp;quot;,&amp;quot;-11&amp;quot;,&amp;quot;*&amp;quot;,&amp;quot;/&amp;quot;,&amp;quot;*&amp;quot;,&amp;quot;17&amp;quot;,&amp;quot;+&amp;quot;,&amp;quot;5&amp;quot;,&amp;quot;+&amp;quot;]
输出：22
解释：该算式转化为常见的中缀算术表达式为：
  ((10 * (6 / ((9 + 3) * -11))) + 17) + 5
= ((10 * (6 / (12 * -11))) + 17) + 5
= ((10 * (6 / -132)) + 17) + 5
= ((10 * 0) + 17) + 5
= (0 + 17) + 5
= 17 + 5
= 22
&lt;/code&gt;&lt;/pre&gt;
&lt;p&gt;&lt;strong&gt;提示：&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;&lt;code&gt;1 &amp;lt;= tokens.length &amp;lt;= 104&lt;/code&gt;&lt;/li&gt;
&lt;li&gt;&lt;code&gt;tokens[i]&lt;/code&gt;  是一个算符（ &lt;code&gt;&amp;quot;+&amp;quot;&lt;/code&gt; 、 &lt;code&gt;&amp;quot;-&amp;quot;&lt;/code&gt; 、 &lt;code&gt;&amp;quot;*&amp;quot;&lt;/code&gt;  或  &lt;code&gt;&amp;quot;/&amp;quot;&lt;/code&gt; ），或是在范围  &lt;code&gt;[-200, 200]&lt;/code&gt;  内的一个整数&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&lt;strong&gt;逆波兰表达式：&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;逆波兰表达式是一种后缀表达式，所谓后缀就是指算符写在后面。&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;平常使用的算式则是一种中缀表达式，如  &lt;code&gt;( 1 + 2 ) * ( 3 + 4 )&lt;/code&gt;  。&lt;/li&gt;
&lt;li&gt;该算式的逆波兰表达式写法为  &lt;code&gt;( ( 1 2 + ) ( 3 4 + ) * )&lt;/code&gt;  。&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;逆波兰表达式主要有以下两个优点：&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;去掉括号后表达式无歧义，上式即便写成  &lt;code&gt;1 2 + 3 4 + * &lt;/code&gt; 也可以依据次序计算出正确结果。&lt;/li&gt;
&lt;li&gt;适合用栈操作运算：遇到数字则入栈；遇到算符则取出栈顶两个数字进行计算，并将结果压入栈中&lt;/li&gt;
&lt;/ul&gt;
&lt;h2 id=&#34;思路分析&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#思路分析&#34;&gt;#&lt;/a&gt; 思路分析：&lt;/h2&gt;
&lt;p&gt;使用栈进行解决：&lt;/p&gt;
&lt;p&gt;比如果遍历到第一个是一个数字 就 将该数字 存入栈中&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;https://raw.githubusercontent.com/PigPigLetsGo/imeages/master/202401081725076.png&#34; alt=&#34;image-20240108172500006&#34; /&gt;&lt;/p&gt;
&lt;p&gt;然后继续遍历 发现 还是数字就 再 存入栈中&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;https://raw.githubusercontent.com/PigPigLetsGo/imeages/master/202401081726001.png&#34; alt=&#34;image-20240108172601954&#34; /&gt;&lt;/p&gt;
&lt;p&gt;继续遍历 发现 是 运算符 那么就 将栈中的 2, 1 弹出 进行当前运算符的 计算，然后入栈 计算结果&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;https://raw.githubusercontent.com/PigPigLetsGo/imeages/master/202401081727831.png&#34; alt=&#34;image-20240108172709783&#34; /&gt;&lt;/p&gt;
&lt;p&gt;继续遍历 是数字 就 存入 栈中&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;https://raw.githubusercontent.com/PigPigLetsGo/imeages/master/202401081728716.png&#34; alt=&#34;image-20240108172816668&#34; /&gt;&lt;/p&gt;
&lt;p&gt;再继续遍历 发现是 运算符 ，将栈中的数字 全部 弹出 并进行当前运算符的计算 然后再存入栈中&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;https://raw.githubusercontent.com/PigPigLetsGo/imeages/master/202401081728750.png&#34; alt=&#34;image-20240108172317021&#34; /&gt;&lt;/p&gt;
&lt;p&gt;我们再看另一种情况&lt;/p&gt;
&lt;p&gt;如下图当遇到了前面都是数字时，全部都 加入栈中，直到遇到运算符就取出栈中的前两个然后 运算再入栈&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;https://raw.githubusercontent.com/PigPigLetsGo/imeages/master/202401110908821.png&#34; alt=&#34;image-20240111090852749&#34; /&gt;&lt;/p&gt;
